import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';

const ServicesContainer = styled.section`
  padding: 8rem 2rem;
  background: ${props => props.theme.colors.white};
`;

const ServicesContent = styled.div`
  max-width: 1200px;
  margin: 0 auto;
`;

const SectionTitle = styled(motion.h2)`
  font-family: ${props => props.theme.fonts.primary};
  font-size: clamp(2.5rem, 5vw, 4rem);
  text-align: center;
  margin-bottom: 3rem;
  color: ${props => props.theme.colors.secondary};
`;

const ServicesGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: 3rem;
  margin-top: 4rem;
`;

const ServiceCard = styled(motion.div)`
  background: ${props => props.theme.colors.white};
  padding: 3rem 2rem;
  border-radius: 20px;
  text-align: center;
  box-shadow: 0 10px 30px rgba(0, 0, 0, 0.1);
  position: relative;
  overflow: hidden;

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    height: 4px;
    background: linear-gradient(45deg, ${props => props.theme.colors.primary}, ${props => props.theme.colors.gold});
  }
`;

const ServiceIcon = styled.div`
  width: 80px;
  height: 80px;
  background: linear-gradient(45deg, ${props => props.theme.colors.primary}, ${props => props.theme.colors.gold});
  border-radius: 50%;
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 0 auto 2rem;
  font-size: 2rem;
`;

const ServiceTitle = styled.h3`
  font-size: 1.5rem;
  font-weight: 600;
  margin-bottom: 1rem;
  color: ${props => props.theme.colors.secondary};
`;

const ServiceDescription = styled.p`
  line-height: 1.6;
  color: ${props => props.theme.colors.secondary};
  opacity: 0.8;
  margin-bottom: 2rem;
`;

const ServiceFeatures = styled.ul`
  list-style: none;
  text-align: left;
`;

const ServiceFeature = styled.li`
  padding: 0.5rem 0;
  color: ${props => props.theme.colors.secondary};
  opacity: 0.7;
  
  &::before {
    content: '‚úì';
    color: ${props => props.theme.colors.primary};
    font-weight: bold;
    margin-right: 0.5rem;
  }
`;

const Services = () => {
  const [ref, inView] = useInView({ threshold: 0.3, triggerOnce: true });

  const services = [
    {
      icon: 'üíé',
      title: 'Custom Design',
      description: 'Bring your vision to life with our bespoke jewelry design service. Our master craftsmen work with you to create unique pieces that tell your story.',
      features: [
        'One-on-one consultation',
        '3D design visualization',
        'Premium materials selection',
        'Lifetime craftsmanship warranty'
      ]
    },
    {
      icon: 'üîß',
      title: 'Repair & Restoration',
      description: 'Expert repair and restoration services to bring your treasured pieces back to their original glory with meticulous attention to detail.',
      features: [
        'Professional assessment',
        'Vintage piece restoration',
        'Stone replacement',
        'Rhodium plating'
      ]
    },
    {
      icon: 'üìè',
      title: 'Resizing & Alterations',
      description: 'Perfect fit guaranteed with our professional resizing and alteration services for rings, bracelets, and necklaces.',
      features: [
        'Ring resizing',
        'Chain length adjustment',
        'Clasp replacement',
        'Setting adjustments'
      ]
    },
    {
      icon: 'üéÅ',
      title: 'Gift Services',
      description: 'Make every occasion special with our premium gift services including elegant packaging and personalized engraving.',
      features: [
        'Luxury gift wrapping',
        'Personal engraving',
        'Gift certificates',
        'Special occasion consultation'
      ]
    },
    {
      icon: 'üîç',
      title: 'Appraisal Services',
      description: 'Professional jewelry appraisal services for insurance, estate planning, or personal knowledge by certified gemologists.',
      features: [
        'Certified appraisals',
        'Insurance documentation',
        'Estate evaluations',
        'Gemstone identification'
      ]
    },
    {
      icon: '‚ú®',
      title: 'Cleaning & Maintenance',
      description: 'Keep your jewelry sparkling with our professional cleaning and maintenance services using ultrasonic technology.',
      features: [
        'Ultrasonic cleaning',
        'Professional polishing',
        'Prong inspection',
        'Maintenance tips'
      ]
    }
  ];

  return (
    <ServicesContainer ref={ref}>
      <ServicesContent>
        <SectionTitle
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8 }}
        >
          Our Services
        </SectionTitle>

        <ServicesGrid>
          {services.map((service, index) => (
            <ServiceCard
              key={index}
              initial={{ opacity: 0, y: 50 }}
              animate={inView ? { opacity: 1, y: 0 } : {}}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              whileHover={{ y: -10, boxShadow: '0 20px 40px rgba(0, 0, 0, 0.15)' }}
            >
              <ServiceIcon>{service.icon}</ServiceIcon>
              <ServiceTitle>{service.title}</ServiceTitle>
              <ServiceDescription>{service.description}</ServiceDescription>
              <ServiceFeatures>
                {service.features.map((feature, featureIndex) => (
                  <ServiceFeature key={featureIndex}>{feature}</ServiceFeature>
                ))}
              </ServiceFeatures>
            </ServiceCard>
          ))}
        </ServicesGrid>
      </ServicesContent>
    </ServicesContainer>
  );
};

export default Services;
